import { Card, Carousel } from 'react-bootstrap';


function CustomCardImg({title='', year='', duration='', images=[]}) {

  return (
    <Carousel>
        {
            images.map((image, index) => (
                <Carousel.Item key={index}>
                    <Card.Img className="img-fluid" src={image} alt="Primer slide"/>
                    <Carousel.Caption>
                        <div className='row' style={{backgroundColor: 'rgba(0, 0, 0, 0.7)'}}>
                            <div className='col'>
                            <h4>{title} <small>({year})</small></h4>
                            <p><small>{duration}</small></p>
                            </div>
                        </div>
                    </Carousel.Caption>
                </Carousel.Item>
            ))
        }
    </Carousel>
  );
}

export default CustomCardImg;
